import React from 'react';
import './Footer.css';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer-container">
        <div className="footer-left">
          <h3>UAC Symposium-4pcancer</h3>
          <p>© 2023 UAC Symposium-4pcancer. Tout droit reservé.</p>
        </div>
      </div>
    </footer>
  );
}

export default Footer;
